responses:
{"Q0":"To see if people will more money will be more willing to donate. I tell you this, that is most likely not true, when a rich person sees a homeless person he/she is less likely to give money to the homeless person because he has never been in that position. He/she would just think that "why don't this person just get a job?"

The middle and low income class are more likely to give money to the poor because at some point in their life, they might have been there or know what it is to like to try to catch a break once. 

In this case, while I sympathize for Jason since my aunt also had Leukemia three years ago, I also really do need the money.   "}
